function App() {
  return (
    <div>
      <Logo />
      <Form />
      <packingList />
      <Stats />
    </div>
  );
}

function Logo() {
  return <h1>Travel List</h1>;
}

function Form() {
  return <div className="add-form">HIER</div>;
}

function packingList() {
  return <div className="list">WIRD</div>;
}

function Stats() {
  return <div className="stats">GELISTET</div>;
}

export default App;
